        text: '李某某与李某甲、李某乙等继承纠纷一审民事判决书辽宁省抚顺市东洲区人民法院民 事 判 决 书(2017) 辽0403民初520号原告： 李某某， 住址抚顺市东洲区。被告： 李某甲，， 现住河北省廊坊市。被告： 李某乙，， 住址抚顺市东洲区。被告： 李某丙， 住址抚顺市东洲区。被告： 李某， 住址抚顺市顺城区。原告李某某与被告李某甲、 李某乙、 李某丙、 李某继承纠纷一案， 本院于2017年2月24日立案后， 依法适用普通程序， 公开开庭进行了审理。 原告李某某， 被告李某乙、 李某丙、 李某到庭参加诉讼。 被告李某甲经依法传唤无正当理由拒不到庭参加诉讼， 本案现已缺席审理终结。原告向本院提出诉讼请求： 1、 扣除原告支付办理丧事费用5756元后继承工资2550元及丧葬费44174元； 2、 诉讼费由原、 被告分担。 事实和理由： 我与被告李某甲、 李某乙、 李某丙系姐妹， 与李某系姑侄关系。 李某父亲李某丁于2006年2月死亡。 原告父亲于1997年5月15日死亡， 母亲张某某于2016年12月15日死亡。 张某某死亡时遗留一个月工资2550元， 丧葬费44174元， 均在李某乙手中。 在处理丧事时， 我支付5756元， 其中在李静饭店花费2475元（ 其中有我五桌半客人）， 其余系母亲生前， 我给买蛋白粉、 尿不湿费用和接送母亲的交通费及母亲去世后圆坟、 买贡品、 餐费的费用。 现要求扣除我的支付后， 依法继承。 对李某丙的花费， 我知情。 对李某乙的花费除在殡仪馆花费外， 丧葬一条龙花费8500元、 买3条烟每条价值200元认可， 其他不认可。被告李某甲书面答辩称,我母亲去世办理丧事期间， 我因腿疼无法回抚参与处理丧事， 但其他子女不应铺张浪费， 超过标准费用应责任人自行承担。 母亲去世前， 我曾赡养3年多， 对遗产要求依法继承。被告李某乙辩称,我认为原告花费不属实。 我从2016年3月至母亲去世花费看病、 救护车、 地段诊疗、 买延寿片等费用。 母亲去世我请丧事一条龙花费9000元， 在李静饭店花费饭钱7610元（ 其中有我六桌半客人）， 还有刻字、 火化费、 买烟、 吃中午饭、 火葬场花费及无票据但记账的药费、 门诊费和救护车费等。 我母亲生前与我生活期间， 她的工资卡由我保管， 2016 年12月份工资由我取出2550元， 丧葬费、 抚恤费44174元也在我处。 我母亲生前欠李某丙2000元， 由我代还的。 对李某丙的花费， 我知情。被告李某丙辩称， 我母亲在二十年前向我借款2000元， 后经李某乙偿还的， 但母亲工资卡在李某乙处， 应系母亲偿还。 我母亲住院期间， 我花费车费和换食道管、 买垫布湿、 手纸的钱应扣除。 对李某乙的花费除在殡仪馆花费外， 丧葬一条龙花费过高不是母亲生前要求的项目， 其他不知情。被告李某辩称， 我父亲李某丁去世后留给奶奶赡养费了， 我要求继承奶奶遗产。当事人围绕诉讼请求依法提交了证据， 本院组织当事人进行了证据交换和质证。 对当事人无异议的死亡证明、 养老保险一次性支付审批表、 殡葬统一收费收据、 墓地发票、 亲属关系证明， 本院予以确认并在卷佐证。 对有争议的证据和事实， 本院认定如下： 对原告提交抚顺市东洲区李静饭店盖章的便笺、 药房收款单据、 专用收款收据、 交通费收据和被告李某乙提交的手写记账明细单、 二姐殡葬用品专营店明细单、 餐费烟钱证明、 交通费收据、 购买延寿片信誉卡， 以上各方提交的证据， 对方质证均不予认可， 因无其他证据加以佐证， 故本院不予确认。 本院经审理认定事实如下： 张某某与李明系夫妻， 二人育有五子女， 长子李某丁、 长女李某甲、 次女李某乙、 三女李某某、 四女李某丙。 张某某于2016年12月去世， 李明于1997年6月去世。 李某丁配偶李玉， 二人育有一女李某， 李某丁于2006年去世。 张某某死亡遗留工资2550元、 社会保险机构发放的丧葬费和抚恤金44， 174 元， 现均已由李某乙取出。 为处理张某某丧事， 李某乙垫付丧葬一条龙费用8500元、 购买烟钱600元、 抚顺县金山殡仪馆火葬费1760元、 龙山息园墓地并葬500元、 殡仪馆及龙山息园其他花费2368元， 以上共计13， 728 元。本院认为， 遗产是公民死亡时遗留的个人合法财产。 遗产按照下列顺序继承： 第一顺序， 配偶、 子女、 父母。 被继承人的子女先于被继承人死亡的， 由被继承人的晚辈直系血亲代位继承。 本案李某丁先于被继承人张某某去世， 其份额应由女儿李某代位继承。 张某某去世后， 单位发放的2016年12月份工资2550元和社会保险机构发放的一次性抚恤金和丧葬费44,174 元， 均在李某乙处， 扣除李某乙办理丧事垫付费用13， 728 元， 余款30446元和2550元共同比照继承方式分配， 原告李某某及被告李某甲、 李某乙、 李某丙、 李某均等分得6599 .2 元。 因上述款项均在李某乙处， 故应由李某乙给付。 关于原告李某某及被告李某乙要求将处理丧事期间宴请宾客的饭费从丧葬费中扣除一节， 因其接待宾客亦从中受益， 故该花费应由其各自自行承担。 关于李某某、 李某乙、 李某丙称其为母亲生前购买营养品、 用品、 看病、 接送治疗和看望产生的交通费等应扣除一节， 一方面张某某有工资可供花费， 另一方面该行为系子女对父母的供养， 孝敬父母系中华民族传统美德， 对待父母应在精神上照顾亦应在物质上提供帮助， 故对上述要求， 本院不予支持。综上所述， 依照《 中华人民共和国继承法》 第十条、 第十一条、 第十三条，《 中华人民共和国民事诉讼法》 第一百四十四条之规定， 判决如下：一、 被告李某乙于本判决发生法律效力之日起三十日内给付李某某、 李某甲、 李某丙、 李某每人现金6599 .2 元；二、 驳回原告其他诉讼请求。如果未按本判决指定的期间履行给付金钱义务， 应当依照《 中华人民共和国民事诉讼法》 第二百五十三条之规定， 加倍支付迟延履行期间的债务利息。案件受理费1213 .74 元（ 原告已预交）， 由原告负担245 .74 元， 被告李某甲、 李某乙、 李某丙、 李某各负担242元。如不服本判决， 可以在判决书送达之日起十五日内， 向本院递交上诉状， 并按对方当事人的人数或者代表人的人数提出副本， 上诉于抚顺市中级人民法院。审 判 长 李晓洁审 判 员 杜晓光人民陪审员 孙思尧二〇一七年四月二十日书 记 员 陈冬卉',
